import React from 'react'
import'./Services.css'
import heartemoji from '../../img/heartemoji.png'
import glasses from '../../img/glasses.png'
import humble from '../../img/humble.png'
import Card from '../Card/Card'
const Services = () => {
  return (
    <div className="services">
        <div className="awesome">
            <span>Technical</span>
            <span>skills</span>
            {/* <span>lorem epsil <br/>llllllll</span> */}
            <a><button className="button s-button">Download resume</button></a>
            <div className='blur s-blur1' style={{background:'#ABF1FF94'}}></div>
        </div>
        <div className="cards">
            <div style={{left:'12rem'}}>
                <Card
                emoji = {heartemoji}
                heading = {'Web development'}
                detail = {"HTML, CSS, Angular, Javascript, React, Typescript"}
                />
            </div>

            <div style={{left:'-2rem', top:'14rem'}}>
                <Card
                emoji = {heartemoji}
                heading = {'IOS developer'}
                detail = {"Swift, SwiftUI, XCode"}
                />
            </div>

            <div style={{top:'14rem', left:'26rem'}}>
                <Card
                emoji = {heartemoji}
                heading = {'Cloud'}
                detail = {"AWS"}
                />
            </div>

            <div style={{left:'40rem'}}>
                <Card
                emoji = {heartemoji}
                heading = {'Programming languages'}
                detail = {"C,Java,Python"}
                />
            </div>

            <div style={{left:'-2rem'}}>
                <Card
                emoji = {heartemoji}
                heading = {'Programming languages'}
                detail = {"C,Java,Python"}
                />
            </div>

            <div style={{left:'26rem'}}>
                <Card
                emoji = {heartemoji}
                heading = {'Databases'}
                detail = {"SQL, Redis, MongoDB, Elastic Search"}
                />
            </div>

            <div style={{left:'12rem',top:'14rem',}}>
                <Card
                emoji = {heartemoji}
                heading = {'DataScience'}
                detail = {"Machine Learning"}
                />
            </div>

            <div style={{left:'40rem',top:'14rem',}}>
                <Card
                emoji = {heartemoji}
                heading = {'Other skills'}
                detail = {"Maven, Spring framework, HTTP, .NET, Node jS, Figma, TDD, Git, Agile, Linux, MATLAB, Informatica, Docker"}
                />
            </div>
        </div>
    </div>

  )
}

export default Services
